  <>
    <a href={href} className={primary ? 'primary' : 'secondary'}>{children}</a>

    <style jsx>{`
      a {
        padding: 18px 30px 20px;
        display: inline-block;
        border-radius: 13px;
        font-size: 19px;
        font-weight: 600;
      } 
      .primary {
        background: white;
        color: #000;

     }
     .secondary {
       background: blue;
    } 
    `}</style>
  </>
)

export default Button
